    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Necedah NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Necedah NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, information about the environment, information
    about the management direction, and strategies for implementation. Key planning
    issues include: Service trust resources, visitor services, habitat management, and
    the Yellow River Focus Area.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
